import React from "react";
import './districtzone.css'

const DistrictZoneGraph = (props) => {
console.log(props.zoneData)
  const red = []
  const orange = []
  const green = []

  props.zoneData.map(zone => {
    zone.zone === 'Red' && red.push(zone.district)
    zone.zone === 'Orange' && orange.push(zone.district)
    zone.zone === 'Green' && green.push(zone.district)
  })

  console.log(red)
  console.log(orange)
  console.log(green)

  return (
    <div className="zones-data">
      <div className="row">
        <div className="col-4 red lighten-4 zone">
          {red.map(dist => (
            <p>{dist}</p>
          ))}
        </div>
        <div className="col-4 orange lighten-4 zone">
        {red.map(dist => (
            <p>{dist}</p>
          ))}
        </div>
        <div className="col-4 green lighten-4 zone">
          {green}
        </div>
      </div>
    </div>
  )
}

export default DistrictZoneGraph
